class Header extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isLoggedIn: false
        }
    }
    render() {
        console.log(this.state)
        if (this.state.isLoggedIn) {
            return (<p>hello, {this.state.userName}</p>);
        } else {
            return (<p>Please Login</p>);
        }
    }
}

export default Header;
